// components/Navbar.js
import React from 'react';
import { Button, Container, Form, Nav, Navbar, NavDropdown, Offcanvas } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const Navbarmenu = () => {
  return (
    // <Nav className='nav' justify variant="underline" defaultActiveKey="/">
    //   <Nav.Item className='navitem'>
    //     <Nav.Link className='navlink' as={Link} to="/">Strona Główna</Nav.Link>
    //   </Nav.Item>
    //   <Nav.Item className='navitem'>
    //     <Nav.Link className='navlink' as={Link} to="/register">Zarejestruj Temat</Nav.Link>
    //   </Nav.Item>
    //   <Nav.Item className='navitem'>
    //     <Nav.Link className='navlink' as={Link} to="/topics">Lista Tematów</Nav.Link>
    //   </Nav.Item>
    //   <Nav.Item className='navitem'>
    //     <Nav.Link className='navlink' as={Link} to="/admin">Panel Administracyjny</Nav.Link>
    //   </Nav.Item>
    // </Nav>
    <>
      {[false, 'sm', 'md', 'lg', 'xl', 'xxl'].map((expand) => (
        <Navbar key={expand} expand={expand} className="bg-body-tertiary mb-3">
          <Container fluid>
            <Navbar.Brand href="#">Navbar Offcanvas</Navbar.Brand>
            <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
            <Navbar.Offcanvas
              id={`offcanvasNavbar-expand-${expand}`}
              aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
              placement="end"
            >
              <Offcanvas.Header closeButton>
                <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}>
                  Offcanvas
                </Offcanvas.Title>
              </Offcanvas.Header>
              <Offcanvas.Body>
                <Nav className="justify-content-end flex-grow-1 pe-3">
                  <Nav.Link href="#action1">Home</Nav.Link>
                  <Nav.Link href="#action2">Link</Nav.Link>
                  <NavDropdown
                    title="Dropdown"
                    id={`offcanvasNavbarDropdown-expand-${expand}`}
                  >
                    <NavDropdown.Item href="#action3">Action</NavDropdown.Item>
                    <NavDropdown.Item href="#action4">
                      Another action
                    </NavDropdown.Item>
                    <NavDropdown.Divider />
                    <NavDropdown.Item href="#action5">
                      Something else here
                    </NavDropdown.Item>
                  </NavDropdown>
                </Nav>
                <Form className="d-flex">
                  <Form.Control
                    type="search"
                    placeholder="Search"
                    className="me-2"
                    aria-label="Search"
                  />
                  <Button variant="outline-success">Search</Button>
                </Form>
              </Offcanvas.Body>
            </Navbar.Offcanvas>
          </Container>
        </Navbar>
      ))}
    </>
  );
};

export default Navbarmenu;
